  //     location: "2634 Druid Hills Way, Unit 2, Charlotte, NC 28206",
  //     price: "$920/month",
  //     image: "house5.webp", // Replace with actual image URL
  //   },
  //   {
  //     id: 6,
  //     title: "3100 Cosby Pl",
  //     location: "3100 Cosby Pl, Charlotte, NC 28205",
  //     price: "$1,350/month",
  //     image: "house6.webp", // Replace with actual image URL
  //   },
  //   {
  //     id: 7,
  //     title: "3100 Cosby Pl",
  //     location: "3100 Cosby Pl, Charlotte, NC 28205",
  //     price: "$1,350/month",
  //     image: "house6.webp", // Replace with actual image URL
